import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./catSwiper.scss";
import '../../../node_modules/swiper/swiper.scss';
import { EffectCards, Pagination } from "swiper";
import "swiper/css/pagination";


export default function CatSwiper(props) {
    return (
        <div>
            <Swiper
                pagination={{
                    type: "progressbar"
                }}
                navigation={true}
                effect={"cards"}
                grabCursor={true}
                modules={[EffectCards, Pagination]}
                className="mySwiper"
            >
                    <SwiperSlide>
                        <div className="cat-swiper-name">{props.name}</div>
                        <div className="cat-swiper-img">{props.img}</div>
                        <div className="cat-swiper-url">{props.url}</div>
                    </SwiperSlide>

            </Swiper>
        </div>
    );
}
